// src/pages/TravellerListening.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function TravellerListening() {
  const [travellers, setTravellers] = useState([]);

  useEffect(() => {
    const fetchTravellers = async () => {
      try {
        const response = await axios.get('/api/travellistening');
        setTravellers(response.data);
      } catch (error) {
        console.error('Error fetching travellers:', error);
      }
    };

    fetchTravellers();
  }, []);

  return (
    <div>
      <h2>Traveller Listening</h2>
      <ul>
        {travellers.map((traveller) => (
          <li key={traveller.id}>{traveller.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default TravellerListening;
